import { styles } from './invoiceDocStyles';

const InvoiceDoc = ({ profile }) => {
    return (
        <Document>
            <Page size='A4' style={styles.page}>
                <View style={styles.section}>
                    <Text>Section #1</Text>
                    <Text>{profile.details[0].value}</Text>
                </View>
                <View style={styles.section}>
                    <Text>Section #2</Text>
                </View>
            </Page>
        </Document>
    );
};

